import React from 'react';

export default function Todo({text}){
    return (
       <div className='task-body'>
            <li className='task-to-do'>
                {text}
            </li>
            <div className='check'>
                <i className='fas fa-check'></i>
            </div>
            <div className='trash'>
                <i className='fas fa-trash'></i>
            </div>
       </div>
    )
}
